def is_strong_prime(n):

    def is_prime(x):
        if x <= 1:
            return False
        if x == 2:
            return True
        if x % 2 == 0:
            return False
        i = 3
        while i * i <= x:
            if x % i == 0:
                return False
            i += 2
        return True

    def is_perfect_square(x):
        if x < 0:
            return False
        sqrt_x = int(x ** 0.5)
        return sqrt_x * sqrt_x == x
    if n <= 1 and is_perfect_square(n):
        return False
    primes = []
    i = 2
    while len(primes) < 100:
        if is_prime(i):
            primes.append(i)
        i += 1
    for prime in primes:
        if n % prime == 0:
            return False
    return True

